import axios from 'axios'
const base_url = 'localhost:5000'

export const requestGetLists = () => {
    return axios.request({
        method: 'get',
        url: 'http://localhost:5000/lists' 
        // url: 'https://my-json-server.typicode.com/atothey/demo/user' 
    })
}
